import React from "react";
import ReactPerfil from "../Img/react-perfil.png";
import FotoFondo from "../Img/fotoFondo.jpg";
import "./Contact.css";
const Contact = () => {
  return (
    <div className="container">
      <div className="row">
        <div className="col bg-success d-flex justify-content-center h-card-contact">
          <div className="container-contact-card bg-danger ">
            <img src={FotoFondo} alt="FotoFondo"></img>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Contact;
